import React from "react";
import { Typography } from "@material-ui/core";

const Footer = () => {
  return (
    <div>
      <center>
        <Typography variant="h4">soy el futer</Typography>
      </center>
    </div>
  );
};

export default withStyles({
  item: {
    minWidth: "300px",
    textAlign: "center",
    margin: "2em",
    borderRadius: "60px",
    backgroundColor: "yellow"
  },
  media: {
    minHeight: "350px",
    minWidth: "350px"
  }
})(Footer);
